import "../Style/header.css"
import myImage from '../Images/LilSkull_white.png';

function Header() {
    return (
        <nav>
            <div id="brand"><img src={myImage} width={30} height={30} alt="LittleSkullIcon" /><span className="name">DAVID ROBERTSON</span><span className="portfolio"> PORTFOLIO</span></div>
            <div>
                <ul id="navLinks">
                    <li className="nav-link">ABOUT</li>
                    <li className="nav-link">PROJECTS</li>
                    <li className="nav-link">CONTACT</li>
                </ul>
            </div>
        </nav>
    );
}

export default Header;
